import * as React from 'react';
import { Button, Text, View, TouchableOpacity, style } from 'react-native';
import BottomNavBar from './Components/BottomNavBar';
import ProileScreen from './ProfileScreen';
import FridgeScreen from './FridgeScreen';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';


import { createDrawerNavigator, DrawerContent } from '@react-navigation/drawer';
import bottomNavBar from './Components/BottomNavBar';

const Drawer = createDrawerNavigator();
const Stack = createStackNavigator();


function MyDrawer() {
  return (
    <Drawer.Navigator screenOptions={{
        headerTitleAlign: 'center',
        contentOptions:{
            alignItems:"center"
        }
        
      }}> 
      <Drawer.Screen name="Glavno" component={bottomNavBar} />
      <Drawer.Screen name="Profil" component={ProileScreen} />
    </Drawer.Navigator>
  );
}

const MainScreen = () => {//adad
    return (
        <MyDrawer></MyDrawer>
      );
};

export default MainScreen;
